import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from "react-router-dom";
export default function Menu(){
    return(
        <>
            <Link to='/CalculIMC'>
                <button className="btn btn-warning w-100 font-weight-bold text-white">CalculIMC</button>
            </Link>
            <Link to='/Historique'>
                <button className="btn btn-light w-100 font-weight-bold text-warning">Historique</button>
            </Link>
            <Link to='/SaisirFilm'>
                <button className="btn btn-warning w-100 font-weight-bold text-white">Saisir Film</button>
            </Link>
            <Link to='/AfficherFilms'>
                <button className="btn btn-light w-100 font-weight-bold text-warning">Afficher Films</button>
            </Link>
        </>
    )
}
